<?php
namespace Cacti\Api\Data;
class Graph{
    private $base64String='data:image/png;base64,';

    protected $amout = 1;

    public function __construct($amount = 1){
        $this->amout = $amount;
    }

    public function create(){
        if($this->amout <= 1){
            return [$this->base64String];
        }

        return array_fill(0, $this->amout, $this->base64String);
    }
}